  \"2015-11-10T01:31:14.088258\",\n\t\"name\": \"rugosity-grid-5-m-derived-from-gridded-bathymetry-of-the-us-territory-of-guam\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Rugosity is derived from gridded (5 m cell
  size) bathymetry from four sources: Multibeam bathymetry collected by Coral Reef
  Ecosystem Division aboard NOAA R/V AHI, and NOAA Ship Hi'ialakai; multibeam bathymetry
  collected in Apra Harbor by the Naval Oceanographic Office and NOAA Office of Coast
  Survey; lidar collected by the Naval Oceanographic Office; and lidar collected by
  the Joint Airborne Lidar Bathymetry Technical Center of Expertise. Rugosity is derived
  using the Benthic Terrain Modeler with rugosity methods by Jeff Jenness (2003).
  Cell values reflect the surface area to planimetric area ratio for the area contained
  within that cell's neighborhood. They provide indices of topographic roughness &
  convolutedness. This data set is for the shelf environment of the US Territory of
  Guam.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
